import React, {Component, useState,useContext} from 'react';
import ReactDOM from 'react-dom';
import {UserContext} from "../../providers/UserProvider";
import './navbar.css';
import {Link} from 'react-router-dom';

const Navbar = (props) => {
  const user = useContext(UserContext);
  const {displayName,photoURL} = user;
  const shouldSignIn = user ? <img src={photoURL} className="userPhoto bg-gray-400 py-2 m-2" /> : <div className="signIn text-gray-700 text-center bg-gray-400 px-4 py-2 m-2" />



  return(
    <div className="navbar flex justify-between">
      {shouldSignIn}

      <div className="login_form"> {user? `Welcome, ${user.displayName}` : "Please Sign In"} /> </div>
      <div className="links"> <Link to="/">Home</Link><Link to="/SignIn">About</Link> </div>
    </div>
  )

};
export default Navbar;
